#update test 2025-02-08 22:40
port: 7890
#port 和 socks-port 分别代表 Clash 的 HTTP 代理端口和 SOCKS5 代理端口。
socks-port: 7891
#port 和 socks-port 分别代表 Clash 的 HTTP 代理端口和 SOCKS5 代理端口。
redir-port: 7892
# 重定向端口（Redirection port），常用于透明代理（transparent proxy）的流量转发

mixed-port: 7893
# 混合代理端口（Mixed port），支持同时处理多种代理协议（如 HTTP 和 SOCKS）

allow-lan: true
# 允许局域网访问，true 表示允许局域网中的设备连接到 Clash 服务
bind-address: '*'
# 绑定地址，'*' 表示监听所有网络接口
mode: Rule
# 运行模式（Mode），这里设置为 Rule 模式，根据规则对流量进行转发
log-level: info
# 日志记录级别（Log level），设为 info 级别，记录一般性信息
ipv6: false


hosts:
# 自定义主机解析（Hosts mapping）：将特定域名直接解析到指定的 IP 地址，绕过 DNS 查询
    services.googleapis.cn: 216.58.200.67
    www.google.cn: 216.58.200.67


external-controller: '0.0.0.0:9090'
# 外部控制器地址（External Controller），允许通过该地址和端口远程控制和管理 Clash

clash-for-android:
    append-system-dns: false
# 针对 Clash for Android 的特殊配置：不将系统 DNS（Domain Name System）追加到配置中    
profile:
    tracing: true
# 配置文件剖面（Profile）：启用 tracing（追踪）功能，便于调试和性能分析    
dns:
    enable: true
    # 启用内置 DNS 解析功能
    listen: '127.0.0.1:8853'
    # DNS 服务监听地址及端口，仅本机可访问

    ## 这些 Default nameservers 用于解析下列 DNS 名称服务器主机名.
    default-nameserver: [223.5.5.5,1.1.1.1, 1.0.0.1,8.8.8.8,223.6.6.6]
   
    ipv6: false
    # 是否启用 IPv6 DNS 解析，false 表示禁用
    enhanced-mode: fake-ip
    # 增强模式（Enhanced mode）：设置为 fake-ip 模式，用于提高解析效率和隐私保护

    # fake-ip-filter：过滤列表中列出的域名将不会使用 fake-ip 模式，而是使用真实 IP 解析

    fake-ip-filter: ['*.lan', 'stun.*.*.*', 'stun.*.*', time.windows.com, time.nist.gov, time.apple.com, time.asia.apple.com, '*.ntp.org.cn', '*.openwrt.pool.ntp.org', time1.cloud.tencent.com, time.ustc.edu.cn, pool.ntp.org, ntp.ubuntu.com, ntp.aliyun.com, ntp1.aliyun.com, ntp2.aliyun.com, ntp3.aliyun.com, ntp4.aliyun.com, ntp5.aliyun.com, ntp6.aliyun.com, ntp7.aliyun.com, time1.aliyun.com, time2.aliyun.com, time3.aliyun.com, time4.aliyun.com, time5.aliyun.com, time6.aliyun.com, time7.aliyun.com, '*.time.edu.cn', time1.apple.com, time2.apple.com, time3.apple.com, time4.apple.com, time5.apple.com, time6.apple.com, time7.apple.com, time1.google.com, time2.google.com, time3.google.com, time4.google.com, music.163.com, '*.music.163.com', '*.126.net', musicapi.taihe.com, music.taihe.com, songsearch.kugou.com, trackercdn.kugou.com, '*.kuwo.cn', api-jooxtt.sanook.com, api.joox.com, joox.com, y.qq.com, '*.y.qq.com', streamoc.music.tc.qq.com, mobileoc.music.tc.qq.com, isure.stream.qqmusic.qq.com, dl.stream.qqmusic.qq.com, aqqmusic.tc.qq.com, amobile.music.tc.qq.com, '*.xiami.com', '*.music.migu.cn', music.migu.cn, '*.msftconnecttest.com', '*.msftncsi.com', localhost.ptlogin2.qq.com, '*.*.*.srv.nintendo.net', '*.*.stun.playstation.net', 'xbox.*.*.microsoft.com', '*.ipv6.microsoft.com', '*.*.xboxlive.com', speedtest.cros.wr.pvp.net]

    # nameserver：自定义的 DNS over HTTPS (DoH) 服务器列表，用于解析 DNS 请求
    # 
    nameserver: ['https://doh.pub/dns-query','https://dns.alidns.com/dns-query','https://223.6.6.6/dns-query', 'https://rubyfish.cn/dns-query', 'https://dns.pub/dns-query']
    
    # fallback：当主要 DNS 解析失败时使用的备用 DNS 服务器列表
    # 某些国内域名解析出问题，使用备用 114 NS 可以提高解析成功率
    fallback: ['114.114.114.114','https://cloudflare-dns.com/dns-query']

    # fallback-filter：备用 DNS 使用时的过滤规则，包括：
    #    - geoip: 是否启用基于地理位置的过滤（true 表示启用）
    #    - ipcidr: 指定 IP 段过滤，不对这些 IP 范围使用备用 DNS
    #    - domain: 针对特定域名（前缀加“+”表示匹配规则）使用备用 DNS
    fallback-filter: { geoip: true, ipcidr: [240.0.0.0/4, 0.0.0.0/32, 127.0.0.1/32], domain: [+.google.com, +.facebook.com, +.twitter.com, +.youtube.com, +.xn--ngstr-lra8j.com, +.google.cn, +.googleapis.cn, +.googleapis.com, +.gvt1.com] }

    # 通过特定的名称服务器查找域名
    nameserver-policy: { 'www.baidu.com': '114.114.114.114'}
    
